12377 pts/0 00:00:00 bash
18304 pts/0 00:00:00 ps When you run it, you get the usual ps output without "Done." message at all. Also, there is no reference to a process called my_ps in the output. The code prints the first message, ps with execlp, and then calls execlp(), which searches the directories given by the PATH environmet variable for a program called ps. It then executes ps in place of my_ps, starting it as if you had issued the shell command: $ ps So, when ps finishes, you get a new shell prompt. You don't return to my_ps. Thus, the second message, "Done.", doesn't get printed. The PID of the new process is the same as the original, as are the parent PID and nice value. To use processes to perform more than one function at a time, you can either use threads or create an extirely separate process from within a program, as init does, rather than replace the current thread of execution, exec, as shown in the above example.

