When you type the interrupt character (Ctrl+c), the ISGINT signal will be sent to the foreground process (the program currently running). This will cause the program to terminate unless it has some arrangement for catching the signal. The command kill can be used to send a signal to a process other than the current foreground process. To send a hangup signal to a shell running on a different terminal, you can use the following command: $ kill -HUP pid_number There is another useful variant of kill is killall. This allows us to send a signal to all processes running a specified command. For example, to send a reread signal to the inetd program: $ killall -HUP inetd The command causes the inetd program to reread its configuration options. In the following example, the program will reacts to the ctrl+c rather than terminating foreground task. But if you hit the ctrl+c again, it will do what it usually does, terminating the program. Create a new file called signals.c nano signals.c #include <stdio.h>
#include <unistd.h>
#include <signal.h> void my_signal_interrupt(int sig)
{ printf("I got signal %d\n", sig); (void) signal(SIGINT, SIG_DFL);
} int main()
{ (void) signal(SIGINT,my_signal_interrupt); while(1) { printf("Waiting for interruption...\n"); sleep(1); }
} Compile and run: gcc signals.c -o signals && ./signals Remember to press ctrl+c to interact and do it a second time to close the program. Output: /signals
Waiting for interruption...
Waiting for interruption...
Waiting for interruption...
Waiting for interruption...
Waiting for interruption...
Waiting for interruption...
Waiting for interruption...
Waiting for interruption...
I got signal 2
Waiting for interruption...
Waiting for interruption...
Waiting for interruption...
Waiting for interruption... The my_signal_interrupt() is called when we give SIGINT signal by typing ctrl+C. After the interrupt function my_signal_interrupt() has completed, the program moves on, but the signal action is restored to the default. So, when it gets a second SIGINT signal, the program takes the default action, which is terminating the program.

