In order of precedence: Stay consistent with what you find; quote your variables; prefer "$var" over ''$var''. These are strongly recommended guidelines but not mandatory regulation. Nonetheless, the fact that it's a recommendation and not mandatory doesn't mean it should be taken lightly or downplayed. They are listed in order of precedence. Stay consistent with what you find for existing code. Quote variables, see section below. Don't brace-delimit single character shell specials / positional parameters, unless strictly necessary or avoiding deep confusion Prefer brace-delimiting all other variables. # Section of *recommended* cases. # Preferred style for 'special' variables:
echo "Positional: $1" "$5" "$3"
echo "Specials: !=$!, -=$-, _=$_. ?=$?, #=$# *=$* @=$@ \$=$$ …" # Braces necessary:
echo "many parameters: ${10}" # Braces avoiding confusion:
# Output is "a0b0c0"
set -- a b c
echo "${1}0${2}0${3}0" # Preferred style for other variables:
echo "PATH=${PATH}, PWD=${PWD}, mine=${some_var}"
while read -r f; do echo "file=${f}"
done < <(find /tmp) # Section of *discouraged* cases # Unquoted vars, unbraced vars, brace-delimited single letter
# shell specials.
echo a=$avar "b=$bvar" "PID=${$}" "${1}" # Confusing use: this is expanded as "${1}0${2}0${3}0",
# not "${10}${20}${30}
set -- a b c
